package Cpt;


public class Cptcourant {


	private int numero;
	private int solde;

	public Cptcourant(int numero, int solde) {		
		numero = this.numero;
		solde = this.solde;
	}
	
	public Cptcourant() {
		// TODO Auto-generated constructor stub
	}

	public int getNumero() {
		return numero;
	}

	public void setNumero(int numero) {
		this.numero = numero;
	}

	public int getSolde() {
		return solde;
	}

	public void setSolde(int solde) {
		this.solde = solde;
	}

}
